import { useRouteError } from 'react-router-dom';
import PageContent from '../components/PageContent';

export const Error = () => {
	const error = useRouteError();

	let title = 'erro default';
	let message = 'message default';

	if (error.status === 500) {
		message = JSON.par(error.data).message;
	}

	if (error.status === 404) {
		title = 'not found';
		message = 'not found';
	}

	return (
		<PageContent title="Error">
			<p>{message}</p>
		</PageContent>
	);
};
